#!/bin/bash

printhelp() {
    local self="${0##*/}"
    echo "Output text as Sans, Papyrus, Toriel, Flowey, Muffet or Undyne. If no text is specified as parameter, stdin is read."
    echo -e "Usage:\n\t$self [options] [string]..."
    echo -e "\nOptions:"
    echo -e "\t-h, --help\t\tShow help."
    echo -e "\t-s, --silent\t\tDisable sound."
    echo -e "\t-n, --noascii\t\tDisable ASCII art."
    echo -e "\t-o, --offset\t\tWhich line to start printing text. Default is 1."
    echo -e "\t-w, --whitespace\tTreat whitespace as character (play sound and sleep)"
    echo -e "\t-i, --indent\t\tKeep indentation after the text passed the ASCII art."
    echo -e "\t-t, --sleep <number>\tHow long to sleep between each char. Default is 0.07. (See also 'man sleep')"
    echo -e "\t-p, --pause <number>\tHow long to sleep on punctuation (,.;:!?). Default is 0.4. Use the same value as -t to disable this behaviour (0.07 by default)."
    echo -e "\t-c, --char <name>\tWhich character to use. Default is Sans. See further down for a list of available characters."
    echo -e "\t-v, --voice <name>\tWhich voice to use. Default is the selected character's voice. See further down for a list of available voices."
    echo -e "\t    --pun\t\tTell a random pun. Implies '-c sans_wink' if not otherwise specified. It has no effect if a string is given as parameter. Requires curl."

    echo -e "\nCharacters:"
    echo -e "\tflowey"
    echo -e "\tflowey_die"
    echo -e "\tflowey_evil"
    echo -e "\tpapyrus"
    echo -e "\tpapyrus_angry"
    echo -e "\tsans"
    echo -e "\tsans_wink"
    echo -e "\tsans_badtime"
    echo -e "\ttoriel"
    echo -e "\tundyne"
    echo -e "\tmuffet"

    echo -e "\nVoices:"
    echo -e "\tflowey"
    echo -e "\tflowey_evil"
    echo -e "\tgeneric"
    echo -e "\tpapyrus"
    echo -e "\tsans"
    echo -e "\ttoriel"
    echo -e "\tundyne"

    echo -e "\nExamples:"
    echo -e "\t$self Do you wanna have a bad time?"
    echo -e "\tls | $self"
    echo -e "\tls | $self -c toriel"
    echo -e "\tclear; $self -o 5 $'On days like these,\\\nkids like you...'; clear; $self -c sans_badtime -o 5 -t 0.15 Should be burning in hell!"
    echo -e "\t$self --pun; $self -c papyrus_angry SAAAAANNSSS\!\!\!\!"
}

newline() {
    LINEWIDTH=0
    echo
    if $ASCII; then
        if [[ $LINE -lt $NUMLINES ]]; then
            printasciiline $LINE
            ((LINE++))
        elif $INDENT; then
            printasciiline -1
        fi
    fi
}

# Prints a line from the ascii art. Without arguments, the whole thing is printed.
# arg1 = line number
printasciiline() {
    if [[ $# -gt 0 ]]; then
        local asciistr="${ASCIIART[$1]}"
        echo -ne "$asciistr"
        ((LINEWIDTH += ${#asciistr}))
    else
        for i in "${ASCIIART[@]}"; do
            echo -e "$i"
        done
    fi
}

# Triggered when script exits, except on SIGKILL.
cleanup() {
    if $ASCII && [[ $LINE -lt $NUMLINES ]]; then
        tput rc
    fi

    echo

    if [[ -n "$SNDFILE" ]]; then
        rm "$SNDFILE"
    fi
}

# Main loop
loop() {
    local ANSI=false
    local NUMCHARS=1
    local char
    local LASTCHAR=''

    while IFS='' read -srn 1 -d '' char; do
        # The input always has a \n at the end, therefore it also works as
        # expected when the last character is in [,;.:!?].
        if [[ "$LASTCHAR" =~ ^[,\;.:!?]$ ]] && [[ "$char" =~ ^[[:space:]]$ ]] && [[ $PAUSE != $SLEEP ]]; then
            sleep $(bc <<< "$PAUSE - $SLEEP")
        fi
        LASTCHAR="$char"

        if [[ "$char" == $'\n' ]]; then
            newline
            continue
        else
            if ! $ANSI; then
                if [[ "$char" == $'\t' ]]; then
                    NUMCHARS=$((TABSIZE - LINEWIDTH % TABSIZE))
                else
                    NUMCHARS=1
                fi

                if [[ $((LINEWIDTH + NUMCHARS)) -gt $COLUMNS ]]; then
                    newline
                fi
                ((LINEWIDTH += NUMCHARS))
            fi

            echo -ne "$char"

            if $WHITESPACE || ! [[ "$char" =~ ^[[:space:]]$ ]]; then
                if [[ "$char" == $'\e' ]]; then
                    ANSI=true
                elif $ANSI && [[ "$char" =~ [a-zA-Z] ]]; then
                    ANSI=false
                elif ! $ANSI; then
                    # $SOUND && mplayer -noconsolecontrols "$SNDFILE" > /dev/null 2>&1 &
                    $SOUND && mpv "$SNDFILE" > /dev/null 2>&1 &
                    sleep $SLEEP
                fi
            fi
        fi
    done
}

main() {
    trap cleanup EXIT

    readoptions "$@"

    # Check if no input was passed.
    if [[ -z "$TEXT" ]] && [[ -t 0 ]]; then
        TEXT="$(echo -e "No text specified.\nUse '${0##*/} -h' or '${0##*/} --help' to view the help.")"
    fi

    TABSIZE=8
    COLUMNS=$(tput cols)

    if $ASCII && [[ $COLUMNS -lt $((TABSIZE + $(printasciiline | wc -L))) ]] ||
        [[ $COLUMNS -lt $TABSIZE ]]; then
        echo "Terminal size too small."
        exit 1
    fi

    LINEWIDTH=0

    # print ascii art
    if $ASCII; then
        LINE=$((1 + STARTLINE))
        NUMLINES=${#ASCIIART[@]}
        printasciiline
        tput sc # restored when text has fewer lines than the ascii art
        for i in $(seq $((NUMLINES - STARTLINE))); do
            # tput sc and tput rc are not reliable here, because if there's
            # not enough space left so that the screen is scrolled down,
            # the wrong position is saved.
            tput cuu1
        done
        printasciiline $STARTLINE
    fi

    if [[ -n "$TEXT" ]]; then
        loop <<< "$TEXT"
    else
        loop < /dev/stdin
    fi
}

readoptions() {
    SOUND=true
    SLEEP=0.07
    ASCII=true
    WHITESPACE=false
    INDENT=false
    PAUSE=0.4
    STARTLINE=1
    TEXT=''
    local VOICE=
    local CHARACTER=

    while [[ $# -gt 0 ]]; do
        case "$1" in
            -h|--help )
                printhelp
                exit
                ;;
            -s|--silent )
                SOUND=false
                ;;
            -n|--noascii )
                ASCII=false
                ;;
            -w|--whitespace )
                WHITESPACE=true
                ;;
            -t|--sleep )
                SLEEP="$2"
                shift
                ;;
            -p|--pause )
                PAUSE="$2"
                shift
                ;;
            -o|--offset )
                STARTLINE="$2"
                shift
                ;;
            -i|--indent )
                INDENT=true
                ;;
            -v|--voice )
                VOICE="$2"
                shift
                ;;
            -c|--char )
                CHARACTER="$2"
                shift
                ;;
            --pun )
                TEXT=$(curl -s https://www.punoftheday.com/cgi-bin/randompun.pl | grep -o -P '(?<=<p>).*(?=</p>)')
                [[ -z "$CHARACTER" ]] && CHARACTER=sans_wink
                ;;
            * )
                TEXT="$@"
                break
                ;;
        esac
        shift
    done

    set_character "${CHARACTER:-sans}" "$VOICE"
}

# Setup a specific character with a voice.
# arg1: name
# arg2: voice (optional)
set_character() {
    local CHARACTER="$1"
    local VOICE="$2"

    if [[ -z "$VOICE" ]]; then
        case "$CHARACTER" in
            flowey_die )
                VOICE=flowey_evil
                ;;
            sans_wink|sans_badtime )
                VOICE=sans
                ;;
            papyrus_angry )
                VOICE=papyrus
                ;;
            flowey|flowey_evil|papyrus|sans|toriel|undyne )
                VOICE="$CHARACTER"
                ;;
            * )
                VOICE=generic
                ;;
        esac
    elif ! [[ "$VOICE" =~ ^(generic|flowey|flowey_evil|papyrus|sans|toriel|undyne)$ ]]; then
        echo "Unknown voice: $VOICE"
        VOICE=generic
    fi

    if ! set_ascii_art "$CHARACTER"; then
        SOUND=false
    fi

    # extract wav
    if $SOUND; then
        SNDFILE="$(mktemp "/tmp/$VOICE.wav.XXXXXXXX")"
        extractsound "$VOICE" "$SNDFILE"
    fi
}

